              ctx.closePath();
              ctx.fillStyle = 'rgba(255, 255, 255, .2)'; // 
              ctx.fill();

              // 
              const gradient = create360Gradient(ctx, size, lightAngle)
              ctx.fillStyle = gradient;
              ctx.fill();

